(144, 'Carl0', '\nYou agree that we take no responsibility for any misuse of this service. This includes chat rooms like our Community Chat.\n\nYou agree that you are the owner and/or are authorized by the owner of the credit card/funds you are using to purchase any of our services.\n\nYou are not allowed to redistribute any of the graphics, software or data found on our website without our permission.\n\nAny violation of any of the terms stated on this page can result in a termination of your account.\n\nWe reserve the right to terminate your account if we deem it necessary at any time, without any prior notice.\n\nYou are not allowed to share or sell access to your carl0.ml account.\n\nWe also reserve ourselves the right to update/change any of the features included with the different packages we provide, which may or may not affect previous purchases.\n\nAll sales are final. If you charge back your payment, our system will automatically terminate your account and any accounts associated with your account. Furthermore, we may block you from further accessing our website.\n\nWe hold the right to end/stop/close the service/project at ANY time without any notification.\n\nDisrespecting any staff or members anywhere on this Site/Skype/Email is not allowed and would Result in an either ban or a suspend .\n', '\nWhen you create an account with us, you must provide us information that is accurate, complete, and current at all times. Failure to do so constitutes a breach of the Terms, which may result in immediate termination of your account on our Service.\n\nYou are responsible for safeguarding the password that you use to access the Service and for any activities or actions under your password, whether your password is with our Service or a third-party service.\n\nYou agree not to disclose your password to any third party. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.\n\nThe use of VPN, proxies or other Ip changing services/methods are not allowed. carl0.ml logs every IP for each account and will warn or terminate an account if notices a change.\n', '\nGiven the nature of downloadable digital items & online services, we do not generally offer a refund or credit on a purchase unless required under Australian consumer law or other relevant consumer protection laws. If you would like to request a refund or credit on a purchase, You must have a legitment reason why you are requesting a refund. We do not respond to poorly written emails or false claims contact staff via a email - bbx.carlo@yahoo.com.', '2018-05-26', 'Changing Or Trying to Change the Password or Email/Username is Not Allowed and will result in a Ban.  Be aware that the accounts generated are shared among users in the database.  Abusing The System such as Generating unnecessary amounts of accounts is not allowed And Will result in a Ban.  Any use of scripts, macros or anything that lets you automatically generate accounts is strictly prohibited. We regularly check for unusual activity, and we will terminate your account if we find you guilty.  The sharing or reselling of accounts is strictly prohibited and will result in the termination of your account. with an exception of sharing the accounts with family members. Security  We value your information and take reasonable precautions to protect it. While we take reasonable steps to preserve the security of your information, please be aware that we can\'t promise that your use of the carl0.ml will be confidential, and we can\'t promise that any information you provide to us is perfectly secure. While using the carl0.ml, you may also become aware of confidential information about us or another member. You promise to not disclose any confidential information made available to you through the carl0.ml to any other person.');
